    return(
        <div className="post-image-form">
            <form onSubmit={event => this.clickHandler(event)}>
                <input type="file" id="pic"></input>
                <button id="post-button">Post</button>
            </form>
        <img id="image1" width="500px" height="500px" />
        </div>
        
    )
}

